function Cart(props) {
	console.log(props.myContacts[0].email);
	props.myContacts[0].forEach()
	return(

		<div>
			<h2>{props.name}</h2>
			<img src={props.img}/>
			<p>{props.phone}</p>
			<p>{props.email}</p>
		</div>
	)
}

export default Cart;
